const qapiurl =  'https://the-trivia-api.com/api/questions';
const capiurl =  'https://the-trivia-api.com/api/categories';


const getQuestions = async () => {
    const res = await axios.get(qapiurl);
    console.log(res);
}
const getCaregories = async () => {
    const res = await axios.get(capiurl);
    console.log(res);
}
useEffect(() => {
    getQuestions();
    getCaregories();
},[])

  return (
        <section>
            <header>
                <h1>Fragebögen</h1>
            </header>
        </section>
  )
}
export default QuestionnairesList
